import './NavBar.css';

import React from "react";
import {EquinorIcon, Icon} from '../../assets/svg/EquinorIcon';

export const NavBar = () => {
  return (
    <div className="NavBar">
      <div className="left">
        <EquinorIcon icon={Icon.MENU}/>
        <span>Neqsim</span>
      </div>
      <div className="right">
        <EquinorIcon icon={Icon.USER}/>
      </div>
    </div>
  );
};
